import React, { useState, useCallback } from "react";
import Button from "@mui/material/Button";
import TextField from "@mui/material/TextField";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import Paper from "@mui/material/Paper";
import IconButton from "@mui/material/IconButton";
import ArrowBackIcon from "@mui/icons-material/ArrowBack";
import Grid from "@mui/material/Grid";
import Container from "@mui/material/Container";
import { styled } from "@mui/material/styles";
import axios from "axios";

var cors = require('cors')

app.use(cors()) // Use this after the variable declaration

// You can replace this with your own Dropzone component or use a plain input
function SimpleDropzone({ onDrop }) {
  return (
    <input
      type="file"
      accept="audio/*"
      onChange={e => e.target.files && onDrop(e.target.files)}
      style={{ marginTop: 16 }}
      required
    />
  );
}

const MyPaper = styled(Paper)({
  borderRadius: 20,
  padding: 20,
  maxWidth: 600,
  margin: "2em auto"
});

export default function SongUploadTest() {
  const [selectedFile, setSelectedFile] = useState(null);
  const [titleValue, setTitleValue] = useState("");
  const [artistValue, setArtistValue] = useState("");
  const [albumValue, setAlbumValue] = useState("");
  const [genreValue, setGenreValue] = useState("");
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [success, setSuccess] = useState(null);

  const handleDrop = files => {
    if (files.length > 0) {
      setSelectedFile(files[0]);
    }
  };

  const handleUpload = async e => {
    e.preventDefault();
    setLoading(true);
    setError(null);
    setSuccess(null);

    if (!selectedFile) {
      setError("No song file selected.");
      setLoading(false);
      return;
    }

    const formData = new FormData();
    formData.append("file", selectedFile); // Backend expects "file"
    formData.append("title", titleValue);
    formData.append("artist", artistValue);
    formData.append("album", albumValue);
    formData.append("genre", genreValue);

    try {
      const response = await axios.post(
        "http://localhost:9000/songs/upload",
        formData
        // No need to set headers: Axios autodetects FormData and sets content-type
      );
      setSuccess("Upload OK!");
    } catch (err) {
      if (err.response && err.response.data) {
        setError("Upload error: " + err.response.data);
      } else {
        setError("Network or CORS error: " + err.message);
      }
    }
    setLoading(false);
  };

  return (
    <MyPaper elevation={8}>
      <Typography variant="h5" gutterBottom>
        Test Song Upload (Dropzone + Axios)
      </Typography>
      <form onSubmit={handleUpload} encType="multipart/form-data">
        <TextField
          fullWidth
          margin="normal"
          label="Title"
          value={titleValue}
          onChange={e => setTitleValue(e.target.value)}
          required
        />
        <TextField
          fullWidth
          margin="normal"
          label="Artist"
          value={artistValue}
          onChange={e => setArtistValue(e.target.value)}
        />
        <TextField
          fullWidth
          margin="normal"
          label="Album"
          value={albumValue}
          onChange={e => setAlbumValue(e.target.value)}
        />
        <TextField
          fullWidth
          margin="normal"
          label="Genre"
          value={genreValue}
          onChange={e => setGenreValue(e.target.value)}
        />
        <SimpleDropzone onDrop={handleDrop} />
        <Box sx={{ mt: 2 }}>
          <Button
            variant="contained"
            color="secondary"
            type="submit"
            disabled={loading}
          >
            {loading ? "Uploadingâ€¦" : "Upload"}
          </Button>
        </Box>
        {success && (
          <Typography color="success.main" sx={{ mt: 2 }}>
            {success}
          </Typography>
        )}
        {error && (
          <Typography color="error" sx={{ mt: 2 }}>
            {error}
          </Typography>
        )}
      </form>
    </MyPaper>
  );
}
